import React from "react";
import { Button, styled } from "@material-ui/core";

const FlexContainer = styled("div")({
  display: "flex",
});

const Navbar = () => {
  return (
    <FlexContainer>
      <Button>Home</Button>
      <Button>Resume</Button>
    </FlexContainer>
  );
};

export default Navbar;
